#https://leetcode.com/problems/valid-palindrome-ii/description/
def isPalindrome(S):
    N = len(S)
    for i in range(N // 2):
        if S[i] != S[N - i - 1]:
            return False
    else:
        return True


# S without i
def swoi(S, i):
    l = list(S)
    l.pop(i)
    return ''.join(l)


class Solution:
    def validPalindrome(self, S):
        """
        :type s: str
        :rtype: bool
        """
        N = len(S)
        for i in range(N // 2):
            if S[i] != S[N - i - 1]:
                if isPalindrome(swoi(S, i)):
                    return True
                else:
                    return isPalindrome(swoi(S, N - i - 1))
        else:
            return True

    def validPalindrome0(self, S):
        """
        :type s: str
        :rtype: bool
        """
        N = len(S)

        cache = [None] * 2
        cache[0] = [{} for i in range(N // 2 + 1)]
        cache[1] = [{} for i in range(N // 2 + 1)]

        def isPalindromDP(l, r, rmc=1):
            '''
            :rmc: removal count
            '''
            if l >= r:
                return True

            if r in cache[rmc][l].keys():
                return cache[rmc][l][r]

            if S[l] == S[r]:
                r1 = isPalindromDP(l + 1, r - 1, rmc)
            else:
                r1 = False

            if rmc > 0:
                r2 = isPalindromDP(l, r - 1, rmc - 1)
                r3 = isPalindromDP(l + 1, r, rmc - 1)
            else:
                r2 = r3 = False

            cache[rmc][l][r] = r1 or r2 or r3
            return cache[rmc][l][r]

        res = isPalindromDP(0, N - 1)
        return res

